import React from 'react';
import { FaBriefcase, FaChartLine, FaPencilAlt } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import styled from 'styled-components';


const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: #FFFFFF;
    padding: 10px 20px;
    color: #333;
`;

const Logo = styled.img`
    height: 50px;
`;

const NavIcons = styled.div`
    display: flex;
`;

const Icon = styled(NavLink)`
    cursor: pointer;
    font-size: 20px;
    padding: 0 35px; // Add padding to each icon
    color: #ccc; // Set the default color to grey
    text-decoration: none; // Remove underline from links

    &.active {
        color: #108A00; // Color for the active icon
    }
`;

const CompanyName = styled.div`
    font-size: 20px;
`;

const Divider = styled.hr`
    border: none;
    border-top: 1px solid #DDDDDD;
    margin: 0;
`;
const Navbar = () => {
    return (
        <>
            <NavbarContainer>
                <Logo src="/assets/images/jobmate.png" alt="Logo" />
                <NavIcons>
                    <Link to="/employer/dashboard"><Icon><FaBriefcase title="Jobs" /></Icon></Link>
                    < Link to="/employer/create_job"><Icon><FaChartLine title="Progress" /></Icon></Link>

                    <Link to="/employer/create_job"><Icon><FaPencilAlt title="Create Job" /></Icon></Link>
                </NavIcons>
                <CompanyName>Grey</CompanyName>
            </NavbarContainer >
            <Divider />
        </>
    );
};

export default Navbar;
